import React, {Component} from 'react'

class Login extends Component{

    constructor(){
        super()

    }




    render(){

        return(
            <div>
                <form onSubmit={(event)=>this.props.handleSubmit(event)}>
                    <input name='user_name' type="text" placeholder="username" onChange={(event) => this.props.handleInputChange(event)}/>
                    <input name='password' type="password" placeholder="password" onChange={(event) => this.props.handleInputChange(event)}/>
                    <input type="submit" value="Submit" onClick={(event) => this.props.handleLoginSubmit(event)}/>
                </form>
            </div>
        )
    }
}

export default Login
